import React,{useState,useEffect} from 'react'


const Display = () => {
    
    const [display , setDisplay]=useState([]);
    const getData=async()=>{
        try {
            const {StoreName,SerialNumber,MaterialNumber,MaterialDesc,OpeningBalance,RecievedQuantity,IssueQuantity,BalanceQuantity,Day_and_Date } = display;
            const data= await fetch("/userinput",{
                method: "POST",
                headers: {
                  "Content-Type": "application/json",
                },
                body: JSON.stringify({
                  StoreName,
                  SerialNumber,
                  MaterialNumber,
                  MaterialDesc,
                  OpeningBalance,
                  RecievedQuantity,
                  IssueQuantity,
                  BalanceQuantity,
                  Day_and_Date,
                }),
            });
            console.log(data.body);
        } catch (error) {
            
        }
    }
    
    useEffect(() => {
        getData();
    }, [])
    return (
        <div>
            <h1>Display</h1>
        </div>
    )
}

export default Display
